When derived or aggregated result(s) are reported in metadata, the reference to the original data quality result may be provided using two attributes:
	The attribute <i>derivedElement</i> references a quality element [and its result(s)] described in the metadata;
	The attribute <i>standaloneQualityEvaluationReportDetails</i> references the part of the standalone quality evaluation report where the original result(s) are described.
